import React from 'react';
import './HITTAHIT.css';
import { Link } from 'react-router-dom';

function HittaHit() {
  return (
    <div className="hittahit-container">
        {/* Navigation Menu */}
      <nav className="navbar">
        <ul className="nav-list">
          <li><Link to="/">Hem</Link></li>
          <li><Link to="/rsvp">OSA</Link></li>
          <li><Link to="/hitta-hit">Hitta hit</Link></li>
        </ul>
      </nav>
      <div className="hittahit-card">
        <h1 className="hittahit-title">Örbyhus Slott</h1>
        <p className="hittahit-subtitle">Kom och fira med oss i Örbyhus slott Orangeri</p>
        <div className="hittahit-map-container">
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d2019.5343451806957!2d17.7091266!3d60.2000065!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4660808ceac82f8b%3A0xaad3a038af1d656b!2sÖrbyhus%20slott!5e0!3m2!1sen!2ssw!4v1683567600000!5m2!1sen!2ssw"
            width="100%"
            height="400"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
        </div>
        <p className="hittahit-info">
          Örbyhus Slott is the stunning venue for our wedding celebration. We can't wait to welcome you to this beautiful location in Sweden.
        </p>
      </div>
    </div>
  );
}

export default HittaHit;

